import './App.css';
import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import HomePage from './HomePage';

const routes = [
  {
    path: '/',
    exact: true,
    navbar: HomePage,
    main: () => {
      <div>SOMETHING HERE</div>;
    },
  },
  {
    path: '/info',
    exact: true,
    navbar: HomePage,
    main: () => {
      <div>INFO</div>;
    },
  },
  {
    path: '/more',
    exact: true,
    navbar: HomePage,
    main: () => {
      <div>MORE STUFF</div>;
    },
  },
];

export default function App() {
  return (
    <Router>
      <div style={{ display: 'flex' }}>
        <div
          style={{
            padding: '10px',
            width: '40%',
            background: '#f0f0f0',
          }}
        >
          <ul style={{ listStyleType: 'none', padding: 0 }}>
            <li>
              <Link to='/'>Home</Link>
            </li>
            <li>
              <Link to='/info'>Bubblegum</Link>
            </li>
            <li>
              <Link to='/more'>Shoelaces</Link>
            </li>
          </ul>

          {routes.map((route, index) => (
            <Route
              key={index}
              path={route.path}
              exact={route.exact}
              component={route.navbar}
            />
          ))}
        </div>

        <div style={{ flex: 1, padding: '10px' }}>
          {routes.map((route, index) => (
            <Route
              key={index}
              path={route.path}
              exact={route.exact}
              component={route.main}
            />
          ))}
        </div>
      </div>
    </Router>
  );
}
